import React from 'react'
import axios from 'axios'

function Read() {
    const [data, setData] = useState([])
    const { id } = useParams()
    useEffect(() => {
        axios(`/student/${id}`)
        .then((res) => {
            console.log(res.data)
            setData(res.data)
        })
        .catch((err) => console.log(err))
    })
    return (
        <table className='table'>
            <thead>
                <tr>
                    <th>Name</th>
                    <th>E-mail</th>
                    <th>Age</th>
                    <th>Gender</th>
                </tr>
            </thead>
        </table>
    )
}

export default Read
